import Navigation from './components/Navigation';
import Home from './components/Home';
import Feeding from './components/Feeding';

function App() {
  return (
    <div className="App">
      <Navigation />
      <Switch>
      <Route path="/" element={<Home />} />
        <Route path="about" element={<About />} />
      </Switch>
    </div>
  );
}

export default App;
